import React, {useEffect} from 'react';
import {useDispatch} from 'react-redux';

const SignIn = () => {
    const dispatch = useDispatch();
    const user = useSelector(selector => selector.user); 
    useEffect( () => {
        console.log(user);
    })
    return (
        <>
        SignIn
        </>
    )
};

export default SignIn;
